import React, { useState } from "react";

export const SignUp = ({ account, addAccount }) => {
  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [duplicate, setDuplicate] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!duplicate) {
      addAccount(name, phone, email,password);
      setName("");
      setPhone("");
      setEmail("");
      setPassword("");
    }
  };

  return (
    <>
      <section>
        <h2>
        </h2>
        <signUpForm
          name={name}
          setName={setName}
          phone={phone}
          setPhone={setPhone}
          email={email}
          setEmail={setEmail}
          password={password}
          setPassword={setPassword}
          handleSubmit={handleSubmit}
        />
      </section>
      <hr />
    </>
  );
};
